import React from 'react'
import './Product.css'
import Products from './Products';
 
export default function Main(props) {
    const {products} = props; 
  return (
            <>
            <div className="all-cards">
                {products.map((product) => {
                    <Products key={product.id} product={product}></Products>
                })}
            </div>
            </>
  )
}
